<script>

    async function getKeyFromPassword(password, salt) {
        const enc = new TextEncoder();
        const keyMaterial = await crypto.subtle.importKey(
            "raw",
            enc.encode(password),
            { name: "PBKDF2" },
            false,
            ["deriveKey"]
        );

        return crypto.subtle.deriveKey(
            {
                name: "PBKDF2",
                salt: salt,
                iterations: 100000,
                hash: "SHA-256"
            },
            keyMaterial,
            { name: "AES-GCM", length: 256 },
            false,
            ["decrypt"]
        );
    }

    function hexStringToUint8Array(hexString) {
        const result = new Uint8Array(hexString.length / 2);
        for (let i = 0; i < hexString.length; i += 2) {
            result[i / 2] = parseInt(hexString.substr(i, 2), 16);
        }
        return result;
    }

    async function decryptAes256Gcm(password, saltHex, nonceHex, ciphertextHex) {
        const enc = new TextEncoder();
        const dec = new TextDecoder();
        const salt = hexStringToUint8Array(saltHex, 'hex');
        const nonce = hexStringToUint8Array(nonceHex, 'hex');
        const ciphertext = hexStringToUint8Array(ciphertextHex, 'hex');

        const key = await getKeyFromPassword(password, salt);

        const decrypted = await crypto.subtle.decrypt(
            {
                name: "AES-GCM",
                iv: nonce
            },
            key,
            ciphertext
        );

        return dec.decode(decrypted);
    }

    function showImage(image_data) {
        console.log("Show image");
        const overlay = document.createElement('div');
        overlay.id = 'my_image_overlay';
        overlay.style.position = 'fixed';
        overlay.style.top = '0';
        overlay.style.left = '0';
        overlay.style.width = '100%';
        overlay.style.height = '100%';
        overlay.style.backgroundColor = 'rgba(0, 0, 0, 0.8)';
        overlay.style.display = 'flex';
        overlay.style.justifyContent = 'center';
        overlay.style.alignItems = 'center';
        overlay.style.zIndex = '1000';
        const img = document.createElement('img');
        img.src = image_data;
        img.style.maxWidth = '90%';
        img.style.maxHeight = '90%';
        img.style.borderRadius = '8px';
        overlay.appendChild(img);
        document.body.appendChild(overlay);
        overlay.addEventListener('click', function () {
            document.body.removeChild(overlay);
        });
    }
